import React, { useRef } from "react";
import emailjs from "@emailjs/browser";

export const ContactUs = (props) => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();
    if (
      userEmail.value === "" ||
      userName.value === "" ||
      message.value === ""
    ) {
      contactTrouble.style.display = "block";
      console.log("test");
    } else {
      emailjs
        .sendForm(
          "service_fk0udqh",
          "template_tak3jx4",
          form.current,
          "KxxaNw4sD52kSXZ0c"
        )
        .then(
          (result) => {
            console.log("Email Sent Successfully");
          },
          (error) => {
            console.log("Something Went Wrong, Email Not Sent.");
            console.log(error.text);
          }
        );
    }

    // const contact = (ev) => {
    //   ev.preventDefault();
    //   if (
    //     userEmail.value === "" ||
    //     userName.value === "" ||
    //     message.value === ""
    //   ) {
    //     contactTrouble.style.display = "block";
    //     console.log("test");
    //   } else {
    //     this.contact_number.value = (Math.random() * 100000) | 0;
    //     emailjs.sendForm("service_rlhl0xh", "template_3s0flsq", this).then(
    //       function () {
    //         console.log("SUCCESS!");
    //         contactInfo.style.fontSize = "2.5rem";
    //         contactInfo.innerHTML =
    //           "Thanks! We'll get back to you as soon as possible.";
    //       },
    //       function (error) {
    //         console.log("FAILED...", error);
    //         contactInfo.style.fontSize = "2.5rem";
    //         console.log(error);
    //         contactInfo.innerHTML =
    //           "Hang on.....something went wrong..somewhere....<br></br>How about this? Just email me directly at jtlovato@gmail.com. Thanks!";
    //       }
    //     );
    //   }
    // });
    // }
    window.onload = function () {
      contact.addEventListener("submit", function (event) {
        event.preventDefault();
        if (
          userEmail.value === "" ||
          userName.value === "" ||
          message.value === ""
        ) {
          contactTrouble.style.display = "block";
          console.log("test");
        } else {
          this.contact_number.value = (Math.random() * 100000) | 0;
          emailjs.sendForm("service_rlhl0xh", "template_3s0flsq", this).then(
            function () {
              console.log("SUCCESS!");
              contactInfo.style.fontSize = "2.5rem";
              contactInfo.innerHTML =
                "Thanks! We'll get back to you as soon as possible.";
            },
            function (error) {
              console.log("FAILED...", error);
              contactInfo.style.fontSize = "2.5rem";
              console.log(error);
              contactInfo.innerHTML =
                "Hang on.....something went wrong..somewhere....<br></br>How about this? Just email me directly at jtlovato@gmail.com. Thanks!";
            }
          );
        }
      });
    };
  };

  return (
    <form className='contact-form' ref={form} onSubmit={sendEmail}>
      <label htmlFor='name'>Your Name</label>
      <input id='name' type='text' name='from_name' />

      <label htmlFor='title'>Title</label>
      <input id='title' type='text' name='title' />

      <label htmlFor='email'>Your Email</label>
      <input id='email' type='email' name='user_email' />

      <label htmlFor='message'>Your Message For Me!</label>
      <textarea id='message' name='message' />

      <input onClick={contact} className='submit' type='submit' value='Send' />

      <div className='contact-info-holder'>
        <span className='contact-span'></span>
        <h3>Other Ways To Contact Me:</h3>
        <div className='link-icon-holder'>
          <a
            href='https://twitter.com/ayodele_odubela'
            rel='noreferrer'
            target='_blank'
          >
            <img src='images/twitter_icon.png' alt='twitter icon' />
          </a>
          <a
            href='https://www.linkedin.com/in/ayodeleodubela/'
            rel='noreferrer'
            target='_blank'
          >
            <img src='images/linkedin_icon.png' alt='twitter icon' />
          </a>
          <a href='mailto: aro1871@gmail.com' rel='noreferrer' target='_blank'>
            <img src='images/email_icon.png' alt='twitter icon' />
          </a>
          <a
            href='https://www.tiktok.com/@aiethics101'
            rel='noreferrer'
            target='_blank'
          >
            <img src='images/tiktok_icon.png' alt='twitter icon' />
          </a>
        </div>
      </div>
    </form>
  );
};
